document.addEventListener('DOMContentLoaded', function(event) { 
	const width = window.innerWidth,
		height = window.innerHeight - 80- 64 - 48,
		nodes = data.nodes.map(d => Object.create(d)),
		links = data.links.map(d => Object.create(d))

	const simulation = d3.forceSimulation(nodes)
		.force('link', d3.forceLink(links).id(d => d.name).distance(300).strength(0.2))
		.force('charge', d3.forceManyBody())
		.force('center', d3.forceCenter(width / 2, height / 2))


	const svg = d3.select('svg')

	const base_group = svg.append('g').attr('id', 'net_container')

	const zoom = d3.zoom()
		.scaleExtent([0.1, 3])
		.translateExtent([[-1000, -1000], [width + 1000, height + 1000]])
		.on('zoom', e => base_group.attr('transform', e.transform))

	svg.call(zoom)

	drag = simulation => {

		function dragstarted(event) {
			if (!event.active) simulation.alphaTarget(0.05).restart()
			event.subject.fx = event.subject.x
			event.subject.fy = event.subject.y
		}

		function dragged(event) {
			event.subject.fx = event.x
			event.subject.fy = event.y
		}

		function dragended(event) {
			if (!event.active) simulation.alphaTarget(0)
			event.subject.fx = null
			event.subject.fy = null
		}

		return d3.drag()
			.on('start', dragstarted)
			.on('drag', dragged)
			.on('end', dragended)
	}

	let link = base_group
		.append('g')
		.attr('class', 'links')
		.selectAll('line')
		.data(links)
		.enter()
		.append('line')
		.attr('class', 'net_link')
		.attr('stroke-width', 3)
		.attr('stroke', d => { 
			if (d.together == 'yes'){
				return '#90EE90'
			} else {
				return '#F08080'
			} 
		})

	let node = base_group.append('g')
		.attr('class', 'nodes')
		.selectAll('g')
		.data(nodes)
		.enter()
		.append('a')
		.append('g')

	let circles = node.append('circle')
		.attr('class', 'net_node')
		.attr('age', d => {
			return d.age
		})
		.attr('class', d => {
			return d.class
		})
		.attr('fill', d => { 
			if (d.survived == 'survived'){
				return '#90EE90'
			} else {
				return '#F08080'
			} 
		})
		.attr('r', 12)
		.call(drag(simulation))
		.on('mouseover.fade', fade(0.1))
		.on('mouseout.fade', fade(1))

	let lables = node
		.append('text')
		.attr('class', 'net_text')
		.attr('x', 10)
		.attr('y', -8)
		.text(d => {
			return (d.name + ' ' + d.age )
		})

	let l_2 = node
		.append('text')
		.attr('class', 'net_text_2')
		.attr('x', 10)
		.attr('y', +2)
		.text(d => {
			return ('class: ' + d.class )
		})
	let l_3 = node
		.append('text')
		.attr('class', 'net_text_2')
		.attr('x', 10)
		.attr('y', +12)
		.text(d => {
			return ('embarked: ' + d.embarked )
		})

	node.append('title')
	  	.text(d => { return d.name })



	simulation
		.nodes(nodes)
		.on('tick', ticked)

	simulation.force('link')
		.links(links)

	function ticked() {
		link
			.attr('x1', d => { return d.source.x })
			.attr('y1', d => { return d.source.y })
			.attr('x2', d => { return d.target.x })
			.attr('y2', d => { return d.target.y })

		node
			.attr('transform', d => {
				return 'translate(' + d.x + ',' + d.y + ')'
			})
	}

	const linkedByIndex = {};
		links.forEach(d => {
		linkedByIndex[`${d.source.index},${d.target.index}`] = 1;
	});

	function isConnected(a, b) {
		//console.log(a.index, b.index)
		return linkedByIndex[`${a.index},${b.index}`] || linkedByIndex[`${b.index},${a.index}`] || a.index == b.index;
	}

	function fade(opacity) {
		return (d, i) => {
			node.style('stroke-opacity', function (o) {
				const thisOpacity = isConnected(i, o) ? 1 : opacity;
				this.setAttribute('fill-opacity', thisOpacity);
				//console.log(i, o)
				return thisOpacity;
			});
		  
			link.style('stroke-opacity', o => (o.source === i || o.target === i ? 1 : opacity));

		};
	}
})